import React, { useEffect, useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import {
  Avatar,
  Box,
  Container,
  Grid,
  Tab,
  Tabs,
  Typography,
} from "@mui/material";
import { Spin, Alert } from "antd";
import UserUpdateForm from "./UserUpdateForm";
import UserReviews from "./UserReviews";
import OrderStatus from "./OrderStatus";
import { getUserProfile } from "../../../redux/actions/productActions";

const UserProfile = () => {
  const dispatch = useDispatch();
  const userProfile = useSelector((state) => state.userProfile);
  const { loading, error, data } = userProfile;
  const userId = JSON.parse(localStorage.getItem("user"))._id;

  useEffect(() => {
    dispatch(getUserProfile(userId));
  }, [dispatch]);

  const [tabIndex, setTabIndex] = useState(0);
  const handleTabChange = (event, newIndex) => {
    setTabIndex(newIndex);
  };

  return (
    <Container maxWidth="md">
      {loading && <Spin />}
      {error && (
        <Alert message="Error" description={error} type="error" showIcon />
      )}
      <Box
        sx={{
          my: 2,
        }}
      >
        <Grid container spacing={2} justifyContent={"center"}>
          <Grid item xs={12} sm={6}>
            <Box
              sx={{
                p: 2,
                boxShadow: 2,
                borderRadius: "10px",
                textAlign: "center",
              }}
            >
              {data && (
                <>
                  <Avatar
                    alt={data.user.username}
                    src={data?.user?.profilePicture}
                    sx={{ width: 80, height: 80, margin: "auto" }}
                  />
                  <Typography variant="h6" gutterBottom>
                    {data.user.username}
                  </Typography>
                  <Typography variant="body1" gutterBottom>
                    {data.user.email}
                  </Typography>
                  <Typography variant="body2" gutterBottom>
                    {data.user.profession}
                  </Typography>
                  <Typography variant="body2" gutterBottom>
                    {data.user?.address?.street} {data.user?.address?.city},{" "}
                    {data.user?.address?.state},{" "}
                    {data.user?.address?.postalCode},{" "}
                    {data.user?.address?.country}
                  </Typography>
                </>
              )}
            </Box>
          </Grid>

          <Grid item xs={12}>
            <Tabs
              value={tabIndex}
              onChange={handleTabChange}
              variant="scrollable"
              scrollButtons="auto"
              sx={{ boxShadow: 2, borderRadius: "10px", mb: 2 }}
            >
              <Tab label="Dashboard" />
              <Tab label="Orders" />
              <Tab label="Reviews" />
            </Tabs>
            <Box sx={{ p: 2, boxShadow: 2, borderRadius: "10px" }}>
              {tabIndex === 0 && (
                <Box sx={{ textAlign: "center" }}>
                  <Typography variant="h5" sx={{ my: 2 }}>
                    Welcome to your Dashboard!
                  </Typography>
                  <UserUpdateForm />
                </Box>
              )}
              {tabIndex === 1 && <OrderStatus />}
              {tabIndex === 2 && data && <UserReviews userId={data.user._id} />}
            </Box>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
};

export default UserProfile;
